import{_ as a,o as r,c as t,a2 as i}from"./chunks/framework.BS-IksUQ.js";const b=JSON.parse('{"title":"Changelog","description":"","frontmatter":{"title":"Changelog"},"headers":[],"relativePath":"guide/changelog.md","filePath":"guide/changelog.md"}'),l={name:"guide/changelog.md"};function o(c,e,d,s,h,n){return r(),t("div",null,[...e[0]||(e[0]=[i('<h1 id="changelog" tabindex="-1">Changelog <a class="header-anchor" href="#changelog" aria-label="Permalink to &quot;Changelog&quot;">​</a></h1><h1 id="changelog-1" tabindex="-1">Changelog <a class="header-anchor" href="#changelog-1" aria-label="Permalink to &quot;Changelog&quot;">​</a></h1><h2 id="v1-0-10-2026-02-22" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.10" target="_blank" rel="noreferrer">v1.0.10</a> (2026-02-22) <a class="header-anchor" href="#v1-0-10-2026-02-22" aria-label="Permalink to &quot;[v1.0.10](https://github.com/szaghi/FLAP/tree/v1.0.10) (2026-02-22)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.9...v1.0.10" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Update StringiFor submodule (<a href="https://github.com/szaghi/FLAP/commit/29aab1a29684061e8c01dde2362475977c83aab7" target="_blank" rel="noreferrer"><code>29aab1a</code></a>)</li></ul><h2 id="v1-0-9-2026-02-22" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.9" target="_blank" rel="noreferrer">v1.0.9</a> (2026-02-22) <a class="header-anchor" href="#v1-0-9-2026-02-22" aria-label="Permalink to &quot;[v1.0.9](https://github.com/szaghi/FLAP/tree/v1.0.9) (2026-02-22)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.8...v1.0.9" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-1" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-1" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Update BeFoR64 submodule (<a href="https://github.com/szaghi/FLAP/commit/6361436485e1ca3bffbd9d8e1e648d4e2b7af900" target="_blank" rel="noreferrer"><code>6361436</code></a>)</li></ul><h2 id="v1-0-8-2026-02-22" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.8" target="_blank" rel="noreferrer">v1.0.8</a> (2026-02-22) <a class="header-anchor" href="#v1-0-8-2026-02-22" aria-label="Permalink to &quot;[v1.0.8](https://github.com/szaghi/FLAP/tree/v1.0.8) (2026-02-22)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.7...v1.0.8" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="ci-cd" tabindex="-1">CI/CD <a class="header-anchor" href="#ci-cd" aria-label="Permalink to &quot;CI/CD&quot;">​</a></h3><ul><li>Deploy pages even if coverage analysis fails (<a href="https://github.com/szaghi/FLAP/commit/55553e50cf1e854594e882600988d344eab3abe8" target="_blank" rel="noreferrer"><code>55553e5</code></a>)</li></ul><h2 id="v1-0-7-2026-02-21" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.7" target="_blank" rel="noreferrer">v1.0.7</a> (2026-02-21) <a class="header-anchor" href="#v1-0-7-2026-02-21" aria-label="Permalink to &quot;[v1.0.7](https://github.com/szaghi/FLAP/tree/v1.0.7) (2026-02-21)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.6...v1.0.7" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="bug-fixes" tabindex="-1">Bug fixes <a class="header-anchor" href="#bug-fixes" aria-label="Permalink to &quot;Bug fixes&quot;">​</a></h3><ul><li>Update third party submodules (<a href="https://github.com/szaghi/FLAP/commit/1ae2da20a61ce724549634fcf7a56791ce7577aa" target="_blank" rel="noreferrer"><code>1ae2da2</code></a>)</li></ul><h3 id="miscellaneous-2" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-2" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Correct GHA ci (<a href="https://github.com/szaghi/FLAP/commit/3463adb783259a5a900c84ef1351b7c1a6e960e5" target="_blank" rel="noreferrer"><code>3463adb</code></a>)</li></ul><h3 id="new-features" tabindex="-1">New features <a class="header-anchor" href="#new-features" aria-label="Permalink to &quot;New features&quot;">​</a></h3><ul><li>Add full VitePress guide and modernise project tooling (<a href="https://github.com/szaghi/FLAP/commit/dbf26286947f54071a21208fa8642c15def3d273" target="_blank" rel="noreferrer"><code>dbf2628</code></a>)</li></ul><h2 id="v1-0-6-2022-07-06" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.6" target="_blank" rel="noreferrer">v1.0.6</a> (2022-07-06) <a class="header-anchor" href="#v1-0-6-2022-07-06" aria-label="Permalink to &quot;[v1.0.6](https://github.com/szaghi/FLAP/tree/v1.0.6) (2022-07-06)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.5...v1.0.6" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-3" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-3" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v1.0.5&#39; into develop</li></ul><p>Fix issue<a href="https://github.com/szaghi/FLAP/issues/2" target="_blank" rel="noreferrer">#2</a></p><p>Fix translate method of surface object. (<a href="https://github.com/szaghi/FLAP/commit/0b65a876fca0086db8bad390234eb005e64283e0" target="_blank" rel="noreferrer"><code>0b65a87</code></a>)</p><ul><li>Analysis not completed (<a href="https://github.com/szaghi/FLAP/commit/33537ce0e5833e969fbe93b90710d02aa976b6d2" target="_blank" rel="noreferrer"><code>33537ce</code></a>)</li><li>Commit before sanite status (<a href="https://github.com/szaghi/FLAP/commit/206763658e1287f3bee1636e4d1237efccfc986c" target="_blank" rel="noreferrer"><code>2067636</code></a>)</li><li>Merge branch &#39;feature/analize_and_improve_speed&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/24606eee7aaa6aa517200ca27d924231d588f0c6" target="_blank" rel="noreferrer"><code>24606ee</code></a>)</li><li>Update submodules (<a href="https://github.com/szaghi/FLAP/commit/3f121cbd7b958c84476653250259779b1d6d62d4" target="_blank" rel="noreferrer"><code>3f121cb</code></a>)</li><li>Clean (<a href="https://github.com/szaghi/FLAP/commit/0612912474fc5f7daf927ff48224f0b2f48bd4b9" target="_blank" rel="noreferrer"><code>0612912</code></a>)</li><li>Update submodules (<a href="https://github.com/szaghi/FLAP/commit/411f11e2a7e96ea0824ec77f0c0b9903e9b44192" target="_blank" rel="noreferrer"><code>411f11e</code></a>)</li><li>Clean (<a href="https://github.com/szaghi/FLAP/commit/95549e56634dd2b012c44003ba16eb24e73dcab4" target="_blank" rel="noreferrer"><code>95549e5</code></a>)</li><li>Update submodules (<a href="https://github.com/szaghi/FLAP/commit/29f6508946880759105561b31b4b0ecc847c06b2" target="_blank" rel="noreferrer"><code>29f6508</code></a>)</li><li>Improve test distance API (<a href="https://github.com/szaghi/FLAP/commit/b1906b1410b65451c2ab66d108a694144142b437" target="_blank" rel="noreferrer"><code>b1906b1</code></a>)</li><li>Add Immersed Boundary field app generator</li></ul><p>Short description</p><p>Add a new program for computing Immersed Boundary field for Xall (<a href="https://github.com/szaghi/FLAP/commit/7c9cea3de456565051a788aa13e5da738ea21437" target="_blank" rel="noreferrer"><code>7c9cea3</code></a>)</p><ul><li>Add new IB generator (<a href="https://github.com/szaghi/FLAP/commit/d5c0732f5de6b91fa4ebdcdce86bea6145dbfc58" target="_blank" rel="noreferrer"><code>d5c0732</code></a>)</li><li>Algorithm checking: AABB failing</li></ul><p>Performed AABB algorithm check: the speedup is poor and the consistency is failing: the computed distance values are varing at refinemnt level varing.</p><p>Must be totally re-implemented. (<a href="https://github.com/szaghi/FLAP/commit/09206413e276073b76f76e9402903fda04a13c61" target="_blank" rel="noreferrer"><code>0920641</code></a>)</p><ul><li>Refresh on new laptop (<a href="https://github.com/szaghi/FLAP/commit/cb2dd3d7374f90fd1b9f4e612d97c003e35a05f9" target="_blank" rel="noreferrer"><code>cb2dd3d</code></a>)</li><li>Minor change to enable NVFortran compilation (<a href="https://github.com/szaghi/FLAP/commit/cff6dff6202e73a08c541f612940ee6b4f7b58cc" target="_blank" rel="noreferrer"><code>cff6dff</code></a>)</li><li>Switch to GH actions (<a href="https://github.com/szaghi/FLAP/commit/455638eedfee696e09c36db8313bb6e77f37eea0" target="_blank" rel="noreferrer"><code>455638e</code></a>)</li></ul><h2 id="v1-0-5-2019-04-12" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.5" target="_blank" rel="noreferrer">v1.0.5</a> (2019-04-12) <a class="header-anchor" href="#v1-0-5-2019-04-12" aria-label="Permalink to &quot;[v1.0.5](https://github.com/szaghi/FLAP/tree/v1.0.5) (2019-04-12)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.4...v1.0.5" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-4" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-4" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Update vecfor (<a href="https://github.com/szaghi/FLAP/commit/e553c4cda0c83075cdfa65e85ceda58c0f633953" target="_blank" rel="noreferrer"><code>e553c4c</code></a>)</li><li>Merge tag &#39;v1.0.4&#39; into develop</li></ul><p>Distance-connectivity made efficient by AABB tree</p><p>Stable release, not fully backward compatible. (<a href="https://github.com/szaghi/FLAP/commit/03dfdb222cf93c72ae6281611caaa3726e55c76d" target="_blank" rel="noreferrer"><code>03dfdb2</code></a>)</p><ul><li>Update vecfor (<a href="https://github.com/szaghi/FLAP/commit/065a8576aeac493f228995e7a0157dbb41d09ffc" target="_blank" rel="noreferrer"><code>065a857</code></a>)</li><li>Fix issue<a href="https://github.com/szaghi/FLAP/issues/2" target="_blank" rel="noreferrer">#2</a></li></ul><p>Translate method of surface object did not recompute metrix, now fixed. (<a href="https://github.com/szaghi/FLAP/commit/91e2a80ccaad541ddcce22f5b4b1e25513cc8f08" target="_blank" rel="noreferrer"><code>91e2a80</code></a>)</p><ul><li>Merge branch &#39;release/1.0.5&#39; (<a href="https://github.com/szaghi/FLAP/commit/3b48721053154dbefd8954affc98ba68905e2e8a" target="_blank" rel="noreferrer"><code>3b48721</code></a>)</li></ul><h2 id="v1-0-4-2018-06-04" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.4" target="_blank" rel="noreferrer">v1.0.4</a> (2018-06-04) <a class="header-anchor" href="#v1-0-4-2018-06-04" aria-label="Permalink to &quot;[v1.0.4](https://github.com/szaghi/FLAP/tree/v1.0.4) (2018-06-04)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.3...v1.0.4" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-5" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-5" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v1.0.3&#39; into develop</li></ul><p>Add merge files method, stable release (<a href="https://github.com/szaghi/FLAP/commit/b12061947565c9e7c4e2dcf92aee89e6564dbea6" target="_blank" rel="noreferrer"><code>b120619</code></a>)</p><ul><li>Temporary stop this feature (<a href="https://github.com/szaghi/FLAP/commit/c7c94f0ffc10a3f2038d8d0992dcc106b5f8b84f" target="_blank" rel="noreferrer"><code>c7c94f0</code></a>)</li><li>Greatly improved nearby search speed by means of AABB tree (<a href="https://github.com/szaghi/FLAP/commit/e2c5c45e9a52dd20da45cdf15bd4744951bab2bc" target="_blank" rel="noreferrer"><code>e2c5c45</code></a>)</li><li>Split STL file handler and STL surface: a more sane approach! Break backward compatibility (<a href="https://github.com/szaghi/FLAP/commit/433ed023b6e18a8fcdee8fb5c61cb55b95da718a" target="_blank" rel="noreferrer"><code>433ed02</code></a>)</li><li>Trim out pointer procedures for not introducing too much F2008 features yet not widely supported (<a href="https://github.com/szaghi/FLAP/commit/88def9db3e3e094420afbbf59d08fe1033ccda58" target="_blank" rel="noreferrer"><code>88def9d</code></a>)</li><li>(re)add AABB STL output (<a href="https://github.com/szaghi/FLAP/commit/92ef922f98e08319d5103ed4a3f50c7280915d84" target="_blank" rel="noreferrer"><code>92ef922</code></a>)</li><li>Add compute_distance method that returns also facet index of closest facet (<a href="https://github.com/szaghi/FLAP/commit/7d066ff2c32252f2502ff04d475a499d863967fe" target="_blank" rel="noreferrer"><code>7d066ff</code></a>)</li><li>Make distance/connectivity computation efficient</li></ul><p>Make distance/connectivity computation efficient: in order to load and analize very big input STL files the distance and connectivity computations have strongly refactored in order to fully exploit AABB tree representation.</p><p>The backward compatibility has been brocken: file handler is now a distinguished object with respect the surface object.</p><p>A new method <code>compute_distance</code> for computing the distance has been added: it returns also the facet closest to the given point, not only the distance. (<a href="https://github.com/szaghi/FLAP/commit/0c927312edf42ce2d4c843e5a63c4f8c3096bec2" target="_blank" rel="noreferrer"><code>0c92731</code></a>)</p><ul><li>Merge branch &#39;release/1.0.4&#39; (<a href="https://github.com/szaghi/FLAP/commit/cce3c217f9b23ac798e877dca0021afdb481b28d" target="_blank" rel="noreferrer"><code>cce3c21</code></a>)</li></ul><h2 id="v1-0-3-2018-05-17" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.3" target="_blank" rel="noreferrer">v1.0.3</a> (2018-05-17) <a class="header-anchor" href="#v1-0-3-2018-05-17" aria-label="Permalink to &quot;[v1.0.3](https://github.com/szaghi/FLAP/tree/v1.0.3) (2018-05-17)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.2...v1.0.3" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-6" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-6" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v1.0.2&#39; into develop</li></ul><p>Add clip method to STL file handler</p><p>Add clip method to STL file handler: triangulated surface can be clipped by means of a bounding box (axis-aligned). Optionally, it is also possible to retain the remainder part of the surface into a separate file handler. (<a href="https://github.com/szaghi/FLAP/commit/b5573d38a7778db74b2116420826549a24cba4e1" target="_blank" rel="noreferrer"><code>b5573d3</code></a>)</p><ul><li>Add method to merge STL files</li></ul><p>Add method to merge STL files (<a href="https://github.com/szaghi/FLAP/commit/f098382f01190da0cafcba3e0d0c36beb9d29dad" target="_blank" rel="noreferrer"><code>f098382</code></a>)</p><ul><li>Add clip and merge to fossilizer (<a href="https://github.com/szaghi/FLAP/commit/f63d63c15f435d1dedb5ab1441b66cfef639d901" target="_blank" rel="noreferrer"><code>f63d63c</code></a>)</li><li>Update README (<a href="https://github.com/szaghi/FLAP/commit/c9c83c9e5454873702fa4a2f54c02fe866a398d8" target="_blank" rel="noreferrer"><code>c9c83c9</code></a>)</li><li>Merge branch &#39;release/1.0.3&#39; (<a href="https://github.com/szaghi/FLAP/commit/c6f6b583194d2119ef951bb6a74c6e96da11b720" target="_blank" rel="noreferrer"><code>c6f6b58</code></a>)</li></ul><h2 id="v1-0-2-2018-05-17" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.2" target="_blank" rel="noreferrer">v1.0.2</a> (2018-05-17) <a class="header-anchor" href="#v1-0-2-2018-05-17" aria-label="Permalink to &quot;[v1.0.2](https://github.com/szaghi/FLAP/tree/v1.0.2) (2018-05-17)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.1...v1.0.2" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-7" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-7" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v1.0.1&#39; into develop</li></ul><p>Add standalone manipulator and automatic nearby facets reconnection</p><p>Stable release, partially backward compatible.</p><p>Add standalone manipulator (src/app/fossilizer.f90) that does quite the same job of admesh (filling holes is only feature missing) and add the automatic facets reconnection of nearby edges being disconnected. (<a href="https://github.com/szaghi/FLAP/commit/e783edee8816bb12a6142199d0d5d9d7027e0ee0" target="_blank" rel="noreferrer"><code>e783ede</code></a>)</p><ul><li>Add clip method to STL file handler</li></ul><p>Add clip method to STL file handler: triangulated surface can be clipped by means of a bounding box (axis-aligned). Optionally, it is also possible to retain the remainder part of the surface into a separate file handler. (<a href="https://github.com/szaghi/FLAP/commit/02ff421588cc9f737cac8598a0321be1711c4024" target="_blank" rel="noreferrer"><code>02ff421</code></a>)</p><ul><li>Merge branch &#39;release/1.0.2&#39; (<a href="https://github.com/szaghi/FLAP/commit/dae3ea6a5c704832ac404f8415018382e8241067" target="_blank" rel="noreferrer"><code>dae3ea6</code></a>)</li></ul><h2 id="v1-0-1-2018-05-16" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.1" target="_blank" rel="noreferrer">v1.0.1</a> (2018-05-16) <a class="header-anchor" href="#v1-0-1-2018-05-16" aria-label="Permalink to &quot;[v1.0.1](https://github.com/szaghi/FLAP/tree/v1.0.1) (2018-05-16)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v1.0.0...v1.0.1" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="bug-fixes-1" tabindex="-1">Bug fixes <a class="header-anchor" href="#bug-fixes-1" aria-label="Permalink to &quot;Bug fixes&quot;">​</a></h3><ul><li>Fix readme broken links (<a href="https://github.com/szaghi/FLAP/commit/1d117b2cf15f31d0ef1b130c5e5197e0d2a78e21" target="_blank" rel="noreferrer"><code>1d117b2</code></a>)</li></ul><h3 id="miscellaneous-8" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-8" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v1.0.0&#39; into develop</li></ul><p>First stable release</p><p>First stable release, features:</p><ul><li>[X] User-friendly methods for IO STL files: <ul><li>[x] input: <ul><li>[x] automatic guessing of file format (ASCII or BINARY);</li><li>[x] load STL file effortless;</li></ul></li><li>[x] output: <ul><li>[x] save STL file effortless;</li></ul></li></ul></li><li>[x] powerful surface analysis and manipulation: <ul><li>[x] build facets connectivity;</li><li>[x] sanitize normals: <ul><li>[x] reverse normals:</li><li>[x] make normals consistent:</li></ul></li><li>[x] compute volume;</li><li>[x] rotate facets;</li><li>[x] translate facets;</li><li>[x] mirror facets;</li><li>[x] resize (scale) facets;</li><li>[x] compute minimal distance: <ul><li>[x] square distance;</li><li>[x] square root distance;</li><li>[x] signed distance: <ul><li>[x] by means of solid angle computation;</li><li>[x] by means of rays intersection count;</li></ul></li><li>[x] AABB (Axis-Aligned Bounding Box) tree acceleration with user defined refinement levels;</li></ul></li><li>[x] point-in-polyhedra test: <ul><li>[x] by means of solid angle computation;</li><li>[x] by means of rays intersection count; (<a href="https://github.com/szaghi/FLAP/commit/b116c2e5b73b59681e563b22315fc6e2bf685cf0" target="_blank" rel="noreferrer"><code>b116c2e</code></a>)</li></ul></li></ul></li></ul><ul><li>Prepare for API documentation (<a href="https://github.com/szaghi/FLAP/commit/0cf10d544964b71c316dbe29279dbd02c2feaa1d" target="_blank" rel="noreferrer"><code>0cf10d5</code></a>)</li><li>Prepare for API documentation (<a href="https://github.com/szaghi/FLAP/commit/b187948eca48e86378d0eb43689b109abfe8ee75" target="_blank" rel="noreferrer"><code>b187948</code></a>)</li><li>Correct README hyperlink to GH pages (<a href="https://github.com/szaghi/FLAP/commit/5b2ae6cf36709cef0261d4eea37d1fafd6cafad7" target="_blank" rel="noreferrer"><code>5b2ae6c</code></a>)</li><li>Update building scripts (<a href="https://github.com/szaghi/FLAP/commit/e2e143b61f5e7836fd06b0b9044f56d33c5ef561" target="_blank" rel="noreferrer"><code>e2e143b</code></a>)</li><li>Merge branch &#39;master&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/583d05294d991f753af790d3a9ac1e76abd7ef0a" target="_blank" rel="noreferrer"><code>583d052</code></a>)</li><li>Add fossilizer, a (partial) emulation of admesh (<a href="https://github.com/szaghi/FLAP/commit/a2f90cf992e1e5b15bb5762acb6c5d9d5b741dbc" target="_blank" rel="noreferrer"><code>a2f90cf</code></a>)</li><li>Merge branch &#39;release/1.0.1&#39; (<a href="https://github.com/szaghi/FLAP/commit/aa0b4b04c2b647fa8a338054fbe61da5e1edea84" target="_blank" rel="noreferrer"><code>aa0b4b0</code></a>)</li></ul><h2 id="v1-0-0-2018-05-09" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v1.0.0" target="_blank" rel="noreferrer">v1.0.0</a> (2018-05-09) <a class="header-anchor" href="#v1-0-0-2018-05-09" aria-label="Permalink to &quot;[v1.0.0](https://github.com/szaghi/FLAP/tree/v1.0.0) (2018-05-09)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v0.9.5...v1.0.0" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-9" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-9" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v0.9.5&#39; into develop</li></ul><p>Add repair methods</p><p>Stable release, fully backward compatible.</p><p>FOSSIL is now able to:</p><ul><li>reconstruct STL connectivity</li><li>compute STL volume</li><li>make normals consistent (<a href="https://github.com/szaghi/FLAP/commit/bbf68078dbf0c039b1cd522817c7b4e8a4a0391a" target="_blank" rel="noreferrer"><code>bbf6807</code></a>)</li></ul><ul><li>Add transformation methods</li></ul><p>Add transformation methods to:</p><ul><li>rotate</li><li>translate</li><li>mirror</li><li>resize (<a href="https://github.com/szaghi/FLAP/commit/3d7fba8ce235fb4c1f23ed8ca699c80b30c63394" target="_blank" rel="noreferrer"><code>3d7fba8</code></a>)</li></ul><ul><li>Update main_page.md (<a href="https://github.com/szaghi/FLAP/commit/7c48c373600abd3342cfc9d76ce755f42563cd1f" target="_blank" rel="noreferrer"><code>7c48c37</code></a>)</li><li>First stable release</li></ul><p>First stable release, features:</p><ul><li>[X] User-friendly methods for IO STL files: <ul><li>[x] input: <ul><li>[x] automatic guessing of file format (ASCII or BINARY);</li><li>[x] load STL file effortless;</li></ul></li><li>[x] output: <ul><li>[x] save STL file effortless;</li></ul></li></ul></li><li>[x] powerful surface analysis and manipulation: <ul><li>[x] build facets connectivity;</li><li>[x] sanitize normals: <ul><li>[x] reverse normals:</li><li>[x] make normals consistent:</li></ul></li><li>[x] compute volume;</li><li>[x] rotate facets;</li><li>[x] translate facets;</li><li>[x] mirror facets;</li><li>[x] resize (scale) facets;</li><li>[x] compute minimal distance: <ul><li>[x] square distance;</li><li>[x] square root distance;</li><li>[x] signed distance: <ul><li>[x] by means of solid angle computation;</li><li>[x] by means of rays intersection count;</li></ul></li><li>[x] AABB (Axis-Aligned Bounding Box) tree acceleration with user defined refinement levels;</li></ul></li><li>[x] point-in-polyhedra test: <ul><li>[x] by means of solid angle computation;</li><li>[x] by means of rays intersection count; (<a href="https://github.com/szaghi/FLAP/commit/c39daf0af904c57535efaeaf0ef36fbc8b9f58ac" target="_blank" rel="noreferrer"><code>c39daf0</code></a>)</li></ul></li></ul></li></ul><ul><li>Merge branch &#39;release/1.0.0&#39; (<a href="https://github.com/szaghi/FLAP/commit/e2a110a109f3a7b14db00ec4cdaf1efcd63b9fd9" target="_blank" rel="noreferrer"><code>e2a110a</code></a>)</li></ul><h2 id="v0-9-5-2018-05-07" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v0.9.5" target="_blank" rel="noreferrer">v0.9.5</a> (2018-05-07) <a class="header-anchor" href="#v0-9-5-2018-05-07" aria-label="Permalink to &quot;[v0.9.5](https://github.com/szaghi/FLAP/tree/v0.9.5) (2018-05-07)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v0.9.0...v0.9.5" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="miscellaneous-10" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-10" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v0.9.0&#39; into develop</li></ul><p>First stable release</p><ul><li>IO work;</li><li>basic sanitize work;</li><li>signed distance computation (with also AABB acceleration) work; (<a href="https://github.com/szaghi/FLAP/commit/3586fcb3ac33ef501e2f8ec412f4f58a6cd85970" target="_blank" rel="noreferrer"><code>3586fcb</code></a>)</li></ul><ul><li>Add utils module (<a href="https://github.com/szaghi/FLAP/commit/75c4fe2625af3b9a6c3788226412be69fa09062f" target="_blank" rel="noreferrer"><code>75c4fe2</code></a>)</li><li>Merge branch &#39;master&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/ec9be4c6c2a044eac98457aabcbcd64a3146dcee" target="_blank" rel="noreferrer"><code>ec9be4c</code></a>)</li><li>Add connectivity reconstruction: sanitize normal must be completed (<a href="https://github.com/szaghi/FLAP/commit/435c0be9be97568131b049eea5643a65d0d0a6c5" target="_blank" rel="noreferrer"><code>435c0be</code></a>)</li><li>Sanitize normals work</li></ul><p>Sanitize normals work (<a href="https://github.com/szaghi/FLAP/commit/a569de1864c3af0bdb9a4f27ff2556f5629bb008" target="_blank" rel="noreferrer"><code>a569de1</code></a>)</p><ul><li>Merge branch &#39;feature/try-to-add-stl-cleanup&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/0ab0d1c41d19c5acd6c09b993c21ce91e1c57e1b" target="_blank" rel="noreferrer"><code>0ab0d1c</code></a>)</li><li>Merge branch &#39;release/0.9.5&#39; (<a href="https://github.com/szaghi/FLAP/commit/a5b2fa208bc8be44c8b7e4b427e65a32a50c6034" target="_blank" rel="noreferrer"><code>a5b2fa2</code></a>)</li></ul><h2 id="v0-9-0-2018-05-02" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v0.9.0" target="_blank" rel="noreferrer">v0.9.0</a> (2018-05-02) <a class="header-anchor" href="#v0-9-0-2018-05-02" aria-label="Permalink to &quot;[v0.9.0](https://github.com/szaghi/FLAP/tree/v0.9.0) (2018-05-02)&quot;">​</a></h2><p><a href="https://github.com/szaghi/FLAP/compare/v0.0.1...v0.9.0" target="_blank" rel="noreferrer">Full Changelog</a></p><h3 id="bug-fixes-2" tabindex="-1">Bug fixes <a class="header-anchor" href="#bug-fixes-2" aria-label="Permalink to &quot;Bug fixes&quot;">​</a></h3><ul><li>Fix travis submodule issue (<a href="https://github.com/szaghi/FLAP/commit/11d44e1bcaeda59c2c98536cf1d0c6c46dd4a48d" target="_blank" rel="noreferrer"><code>11d44e1</code></a>)</li></ul><h3 id="miscellaneous-11" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-11" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Merge tag &#39;v0.0.1&#39; into develop</li></ul><p>First beta release. (<a href="https://github.com/szaghi/FLAP/commit/7c8268f6843de6770348168da85869deffd9671e" target="_blank" rel="noreferrer"><code>7c8268f</code></a>)</p><ul><li>Update travis deploy (<a href="https://github.com/szaghi/FLAP/commit/75c296e90a0e075fd08b95b328b45dce920439d4" target="_blank" rel="noreferrer"><code>75c296e</code></a>)</li><li>Merge branch &#39;master&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/4e08ea75a7ae8f5c7f04d0e48ab6e2384c7fb00d" target="_blank" rel="noreferrer"><code>4e08ea7</code></a>)</li><li>Add normal check methods</li></ul><p>Add methods to check and sanitize normals consistency with vertices data. (<a href="https://github.com/szaghi/FLAP/commit/3e020bd852e4018ea4e91ed9a8795adee912876b" target="_blank" rel="noreferrer"><code>3e020bd</code></a>)</p><ul><li>Add distance computation: projection point region analysis must be introduced (<a href="https://github.com/szaghi/FLAP/commit/190db77635735b7f96e6a23b970a12bb65c6f366" target="_blank" rel="noreferrer"><code>190db77</code></a>)</li><li>Signed distance computation works, must be made more efficient (<a href="https://github.com/szaghi/FLAP/commit/0b3f199724e827cf028ca8cf595c2fe40b1f679e" target="_blank" rel="noreferrer"><code>0b3f199</code></a>)</li><li>Merge branch &#39;feature/add-compute-distance-method&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/190a54a396924d3750fbd1f3e404a00fb5c1e13c" target="_blank" rel="noreferrer"><code>190a54a</code></a>)</li><li>Add aabb_object, methods must be still implemented (<a href="https://github.com/szaghi/FLAP/commit/37eefd6d1d553507be232dd5581fa7dd3ddd9242" target="_blank" rel="noreferrer"><code>37eefd6</code></a>)</li><li>Improve aabb object (<a href="https://github.com/szaghi/FLAP/commit/390be2c4c6e363cf1e0b0a8ec35e62e7d865c44f" target="_blank" rel="noreferrer"><code>390be2c</code></a>)</li><li>Step over on AABB tree construction (<a href="https://github.com/szaghi/FLAP/commit/8b2ce567b16a99abba84be90eb752710f378bf40" target="_blank" rel="noreferrer"><code>8b2ce56</code></a>)</li><li>Big step toward AABB acceleration (<a href="https://github.com/szaghi/FLAP/commit/831d281d6f2739d0a651bf93cc889038710d75b8" target="_blank" rel="noreferrer"><code>831d281</code></a>)</li><li>Add working AABB-based distance computation</li></ul><p>Add working AABB-based distance computation: the distance now can be computed by brute-force search over all facets or by AABB-refinement search.</p><p>The sing computation is still available only by brute force search. (<a href="https://github.com/szaghi/FLAP/commit/bd3cc01c3ac2044f344f6c719918d448ef1eeaa0" target="_blank" rel="noreferrer"><code>bd3cc01</code></a>)</p><ul><li>Update readme (<a href="https://github.com/szaghi/FLAP/commit/a04112906fe82541926db5a643c66d65587dd11b" target="_blank" rel="noreferrer"><code>a041129</code></a>)</li><li>Add aabb extents update in initialization (<a href="https://github.com/szaghi/FLAP/commit/fd5e82a3fc9c500fadb822c683fb50a782b63e70" target="_blank" rel="noreferrer"><code>fd5e82a</code></a>)</li><li>Remove not useful aabb_cloud search (<a href="https://github.com/szaghi/FLAP/commit/043864ee60c92264ae323513893b6b088674e500" target="_blank" rel="noreferrer"><code>043864e</code></a>)</li><li>Add full AABB acceleration</li></ul><p>Add full AABB acceleration: both distance and sign computations can now be accelerated by means of AABB tree refinement. (<a href="https://github.com/szaghi/FLAP/commit/7c84e423242ca4ab974c29ed328d482e148a4c7b" target="_blank" rel="noreferrer"><code>7c84e42</code></a>)</p><ul><li>Merge branch &#39;feature/add-aabb-ray-intersection-test&#39; into develop (<a href="https://github.com/szaghi/FLAP/commit/38b1cb6390a33d6a656dfd057c4ab92876f66776" target="_blank" rel="noreferrer"><code>38b1cb6</code></a>)</li><li>Update fobos coverage (<a href="https://github.com/szaghi/FLAP/commit/a2fb5af37da485d3c17a1d0f2cd242c08df30985" target="_blank" rel="noreferrer"><code>a2fb5af</code></a>)</li><li>Merge branch &#39;release/0.9.0&#39; (<a href="https://github.com/szaghi/FLAP/commit/2165b69ffc7c5b772066e04066b4ae3855ad262e" target="_blank" rel="noreferrer"><code>2165b69</code></a>)</li></ul><h2 id="v0-0-1-2018-04-10" tabindex="-1"><a href="https://github.com/szaghi/FLAP/tree/v0.0.1" target="_blank" rel="noreferrer">v0.0.1</a> (2018-04-10) <a class="header-anchor" href="#v0-0-1-2018-04-10" aria-label="Permalink to &quot;[v0.0.1](https://github.com/szaghi/FLAP/tree/v0.0.1) (2018-04-10)&quot;">​</a></h2><h3 id="miscellaneous-12" tabindex="-1">Miscellaneous <a class="header-anchor" href="#miscellaneous-12" aria-label="Permalink to &quot;Miscellaneous&quot;">​</a></h3><ul><li>Init</li></ul><p>First commit of FOSSIL library, a pure Fortran library to parse STL files. (<a href="https://github.com/szaghi/FLAP/commit/56d5266c89001e63f6c1c00ba3fe5579f67f928b" target="_blank" rel="noreferrer"><code>56d5266</code></a>)</p><ul><li>Add facet object and much more</li></ul><p>Add facet object and much more:</p><ul><li>add facet object</li><li>add file stl object</li><li>add file stl IO with test in both ascii and binary forms (<a href="https://github.com/szaghi/FLAP/commit/870ce8228ce4f582a42b96edcd5178a9da85f97f" target="_blank" rel="noreferrer"><code>870ce82</code></a>)</li></ul><ul><li>FOSSIL first beta</li></ul><p>FOSSIL first beta: Fortran parser of STL files. (<a href="https://github.com/szaghi/FLAP/commit/24cb1621f30bdaf8f93b449c8f8c7edba07d9ff0" target="_blank" rel="noreferrer"><code>24cb162</code></a>)</p><ul><li>Merge branch &#39;release/0.0.1&#39; (<a href="https://github.com/szaghi/FLAP/commit/3cc41f45a8d6c6fe81b611af432cfdff92da8923" target="_blank" rel="noreferrer"><code>3cc41f4</code></a>)</li></ul>',132)])])}const u=a(l,[["render",o]]);export{b as __pageData,u as default};
